<?php
/**
 * Tests the frontend functionality
 */
class AxisFrontendTest extends WP_UnitTestCase {

	// Code coverage tests

	/**
	 * @covers AxisWP::convert_png_to_interactive
	 * @todo update to not use PNGs.
	 */
	function test_convert_png_to_interactive() {
		// Arrange
		$test_data = '<img class="axisChart" data-axisjs="" src="data:image/png;base64," />';

		// Act
		$result = apply_filters( 'the_content', $test_data );

		// Assert
		$this->assertNotRegExp( '/^.*?data:image\/png;base64,.*?$/', $result, 'convert_png_to_interactive() not stripping data-uris' );
		$this->assertNotRegExp( '/^<img class=/', $result, 'convert_png_to_interactive() not changing to DIV.');
	}

	/**
	 * @covers AxisWP::add_frontend_js
	 */
	function test_add_frontend_js() {
		// Arrange
		$axisWP = new AxisWP;
		$GLOBALS['wp_scripts'] = new WP_Scripts();

		// Act
		$axisWP->add_frontend_js();

		// Assert
		$this->assertArrayHasKey('axis', $GLOBALS['wp_scripts']->registered, 'axis.js not registered' );
		$this->assertArrayHasKey('d3js', $GLOBALS['wp_scripts']->registered, 'd3.js not registered' );
		$this->assertArrayHasKey('c3js', $GLOBALS['wp_scripts']->registered, 'c3.js not registered' );
		$this->assertArrayHasKey('c3jsCSS', $GLOBALS['wp_styles']->registered, 'c3.js CSS not registered' );
	}

