	/**
	 * Ensure AxisWP::convert_png_to_interactive() doesn't inject additional doctype declarations
	 * @see https://www.github.com/times/Axis/issues/8
	 */
	function test_character_encoding() {
		// Arrange
		$test_data = 'LLAMA ££@@€€€€$$$$$<br /><div class="mceNonEditable"><img class="mceItem axisChart" src="data:image/png;base64," alt="" data-axisjs="" /></div><br/>DUCK ££@@€€€€$$$$$';
		$id = $this->factory->post->create( array( 'post_content' => $test_data ) );

		// Act
		$post = get_post($id);
		$content = apply_filters( 'the_content', $post->post_content );

		// Assert
		$this->assertNotRegExp( '/<!doctype/i', $content );
		$this->assertRegExp('/LLAMA &pound;&pound;@@&euro;&euro;&euro;&euro;\$\$\$\$\$/', $content );
		$this->assertRegExp('/DUCK &pound;&pound;@@&euro;&euro;&euro;&euro;\$\$\$\$\$/', $content );
	}


	public function setUp() {
			parent::setUp();
	}

	public function tearDown() {
			parent::tearDown();
	}
